  setVale(newValue);
};

export const MuiBottomNavigation = () => {
  const [value, setVale] = useState(0);
  return (
    <BottomNavigation className="bottom-nav" value={value} onChange={handleChange}>
      <Link to={`/${pages[0]}`}>
        <BottomNavigationAction className="btn" label="Home" icon={<HomeRoundedIcon />} link />
